ModelBussiness.prototype.flashObjsNames = [];


//修改模型状态
/*
type:类型（见TypeConfig.json文件）
name:名称（命名规则）"dev_"+类型+"_"+名称+桩号 ，所有特殊符号用下划线替换
state:字符串  在线:1 离线:0 故障:-1
            风向袋的状态值：1_度数 度数的取值范围0到Math.PI*2
            四可变信号灯:10000 第一位表示在线 离线 故障
                                后面四位分别表示每个灯的亮和灭 
*/
ModelBussiness.prototype.changeDevState = function (name, state) {
    var _this = this;
    var modelJson = "";
    var obj = WT3DObj.commonFunc.findObject(name);
    if (!obj&&obj.name.indexOf("dev_")!=0) {
        return;
    }
    var type = obj.name.split("_")[1];
    WT3DObj.commonFunc.flashObjs([obj], obj.name + "_flashanimation_", 0x000000, -1, 200, 0);
    if (state == "0" || (parseInt(state) == 0)) {
        setTimeout(function () {
        WT3DObj.commonFunc.flashObjs([obj], obj.name + "_flashanimation_", 0xff0000, 0, 200, 0);
        _this.flashObjsNames.push(obj.name);
        }, 500);
   } else if (state == "-1" || (parseInt(state) < 0)) {
            setTimeout(function () {
                WT3DObj.commonFunc.flashObjs([obj], obj.name + "_flashanimation_", 0xffff00,0, 200, 0);
                _this.flashObjsNames.push(obj.name);
            }, 500);
       } else if (parseInt(state) >= 1) {
        var _index = _this.flashObjsNames.indexOf(obj.name);
        if (_index >= 0) {
            _this.flashObjsNames.splice(_index, 1);
            WT3DObj.commonFunc.flashObjs([obj], obj.name + "_flashanimation_", 0x000000, -1, 200, 0);
        }
    }
    switch (type) {
        case "FXD"://风向袋 参照实际,三维图上示意处理 1_度数
            {
                var stateArray = state.split("_");
                var degree = parseFloat(stateArray[1]);//y轴旋转度数
                obj.rotation.y = degree;
            }
            break;
        case "SKBXHD"://四可变信号灯 在线 离线 故障  4种信号灯单独显示(灭/亮) 1 0 -1 10000(后面四位表示每个信号灯状态)
            {
                var stateArray = state.split("");
              
                if (stateArray[1] == "1") {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[4], 1, "../img/3dImg/left.png");
                } else {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[4], 1, "../img/3dImg/nolight.png");
                }
                if (stateArray[2] == "1") {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[2],1, "../img/3dImg/golight.png");
                } else {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[2], 1, "../img/3dImg/nolight.png");
                }
                if (stateArray[3] == "1") {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[5], 1, "../img/3dImg/yellowlight.png");
                } else {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[5], 1, "../img/3dImg/nolight.png");
                }
                if (stateArray[4] == "1") {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[6],1, "../img/3dImg/redlight.png");
                } else {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[6], 1, "../img/3dImg/nolight.png");
                }
                if (parseInt(state) < 0) {
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[4], 1, "../img/3dImg/nolight.png");
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[2], 1, "../img/3dImg/nolight.png");
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[5], 1, "../img/3dImg/nolight.png");
                    WT3DObj.commonFunc.setObjSkinImg(obj.children[6], 1, "../img/3dImg/nolight.png");
                }
            }
            break;
        case "CDZSD"://车道指示灯   在线 离线 故障 绿箭头  红叉  1 0 -1 2 3
            {
                if (parseInt(state) == 2) {
                    WT3DObj.commonFunc.setObjSkinImg(obj, 0, "../img/3dImg/go.png");
                } else if (parseInt(state) == 3) {
                    WT3DObj.commonFunc.setObjSkinImg(obj, 0, "../img/3dImg/stop.png");
                }
            }
            break;
        case "QXG"://气象仪  在线 离线 故障 1 0 -1
        case "YKSXJ"://遥控摄像机  在线 离线 故障 1 0 -1
        case "WBJCY"://微波车辆检测器  在线 离线 故障 1 0 -1
        case "MJSQBB"://门架式情报板  在线 离线 故障 1 0 -1
        case "XBGZ"://悬臂杆子  在线 离线 故障 1 0 -1
        case "GZ1"://杆子1  在线 离线 故障 1 0 -1
        case "XBSQBB"://悬臂式情报板  在线 离线 故障 1 0 -1
        case "GZ2"://杆子2  在线 离线 故障 1 0 -1
        case "QYKZQ"://区域控制器  在线 离线 故障 1 0 -1
        case "GDSXJ"://固定摄像机  在线 离线 故障 1 0 -1
            {
            }
            break;
    }
}
/*
aciton_id：本次闪动事件的id  请保持唯一性即可 这个主要用于清楚停止本事件时方便查找
names:名称数组（命名规则）"dev_"+类型+"_"+名称+桩号 ，所有特殊符号用下划线替换
times：闪动次数 0表示永久 -1表示停止 其它正整数表示闪动次数
color 表示闪动的颜色 例如红色用16进制0xFF0000表示  注意 不需要双引号
*/
ModelBussiness.prototype.flashAlarmObjs = function (aciton_id,names,times,color) {
    var objs = WT3DObj.commonFunc.findObjectsByNames(names);
    WT3DObj.commonFunc.flashObjs(objs, aciton_id + "_alarm_flashanimation", color, times, 200, 0);
}


//修改模型参数 位置 缩放 角度
/*
name:"dev_"+类型+"_"+名称+桩号 ，所有特殊符号用下划线替换
position:在三维中的位置，可通过任意添加一个位置，然后调整到合适位置，格式{x:0,y:0,z:0}
scale:模型的缩放，格式{x:1,y:1,z:1} x y z的值大于0
rotation:模型旋转，格式{x:0,y:0,z:0} x y z的值取值范围是0到Math.PI*2
*/
ModelBussiness.prototype.changeObjParam = function (name, position, scale, rotation) {
    var obj = WT3DObj.commonFunc.findObject(name);
    if (position) {
        obj.position.x = position.x;
        obj.position.y = position.y;
        obj.position.z = position.z;
    }
    if (scale) {
        obj.scale.x = scale.x;
        obj.scale.y = scale.y;
        obj.scale.z = scale.z;
    }
    if (rotation) {
        obj.rotation.x = rotation.x;
        obj.rotation.y = rotation.y;
        obj.rotation.z = rotation.z;
    }
}


//获取模型参数 位置 缩放 角度
/*
name:"dev_"+类型+"_"+名称+桩号 ，所有特殊符号用下划线替换
*/
ModelBussiness.prototype.getObjParam = function (name) {
    var obj = WT3DObj.commonFunc.findObject(name);
    return {
        position: {
            x: obj.position.x,
            y: obj.position.y,
            z: obj.position.z,
        },
        scale: {
            x: obj.scale.x,
            y: obj.scale.y,
            z: obj.scale.z,
        },
        rotation: {
            x: obj.rotation.x,
            y: obj.rotation.y,
            z: obj.rotation.z,
        }
    }
}
//根据设备名称定为设备 并且返回模型对象
/*
name:"dev_"+类型+"_"+名称+桩号 ，所有特殊符号用下划线替换
callBack:定为完成后回调函数
*/
ModelBussiness.prototype.LocationObj = function (name,callBack) {
    var obj = WT3DObj.commonFunc.findObject(name);
    if (obj) {
        CloseDistance(obj, function () {
            if (callBack) {
                callBack();
            }
        });
    }
    return obj;
}